window.bookSummaryJSON = "<p><b>It's the end of the world as we know it, but someone still needs to do the paperwork.</b></p> <p>Incomprehensible horrors from beyond are going to devour our world, but thatâ€™s no excuse to get all emotional about it. </p> <p>Morag Murray works for the secret government organization responsible for making sure the apocalypse goes as smoothly and as quietly as possible. In her first week on the job, Morag has to hunt down a man-eating starfish, solve a supernatural murder, and, if she's got time, prevent her own inevitable death. </p> <p><i>Oddjobs </i>is a sideswipe at the world of work and a fantastical adventure featuring amphibian wannabe gangstas, mad old cat ladies, ancient gods, apocalyptic scrabble, fish porn, telepathic curry, and, possibly, the end of the world before the weekend.</p>"; 
